// components/GroceryListPage.js
import React from "react";
import "./MenuSubstitutions.css"; // reuse styling

const GroceryListPage = ({ groceryList }) => {
  return (
    <div className="grocery-list-page">
      <h2>Grocery List</h2>
      {groceryList.length === 0 ? (
        <p>No grocery items needed.</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Item</th>
              <th>Qty</th>
            </tr>
          </thead>
          <tbody>
            {groceryList.map((item, idx) => (
              <tr key={idx}>
                <td>{item.item}</td>
                <td>{item.qty}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default GroceryListPage;
